import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { InfectionPulmonaire } from 'src/app/models/InfectionPulmonaire';
import { PulmonaireService } from 'src/app/services/pulmonaire.service';

@Component({
  selector: 'app-pulmonaire',
  templateUrl: './pulmonaire.component.html',
  styleUrls: ['./pulmonaire.component.css']
})
export class PulmonaireComponent {
  complications: InfectionPulmonaire[] = [new InfectionPulmonaire()];
  errorMessage: string = '';

  constructor(private PulmonaireService: PulmonaireService) {}

  addComplication() {
    this.complications.push(new InfectionPulmonaire());
  }

  onSubmit() {
    for (let complication of this.complications) {
      this.PulmonaireService.addpul(complication).subscribe(
        response => {
          console.log('Complication added successfully', response);
          this.errorMessage = '';
        },
        (error: HttpErrorResponse) => {
          console.error('Error adding Complication', error);
          this.errorMessage = error.error.title;
          if (error.error.errors) {
            for (const [field, errors] of Object.entries(error.error.errors)) {
              console.error(`Validation error for ${field}:`, errors);
            }
          }
        }
      );
    }
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    .form-container {
      max-width: 1200px;
      margin: 0 auto;
      padding: 20px;
      background-color: #f0f0f0;
    }
    .form-container h1, .form-container h2 {
      text-align: center;
      font-weight: bold;
      font-family: 'Arial', sans-serif;
      text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.1);
      padding-bottom: 10px;
      display: inline-block;
      margin-bottom: 30px;
    }
    .form-container h1 {
      font-size: 36px;
      color: #2c3e50;
      border-bottom: 3px solid #3498db;
    }
    .form-container h2 {
      font-size: 30px;
      color: #c95355;
      border-bottom: 3px solid #f12349;
    }
    .form-container form {
      background-color: #f9f9f9;
      padding: 20px;
      border-radius: 10px;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1);
    }
    .form-container form div {
      margin-bottom: 15px;
    }
    .form-container form label {
      display: block;
      margin-bottom: 5px;
      font-weight: bold;
      text-transform: capitalize;
    }
    .form-container form input, .form-container form select {
      width: 100%;
      padding: 10px;
      margin: 8px 0;
      border: 1px solid #ccc;
      border-radius: 5px;
    }
    .form-container form .submit-row {
      text-align: center;
      margin-top: 20px;
    }
    .form-container form input[type="submit"] {
      background-color: #000 !important;
      color: #fff !important;
      padding: 12px 20px;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }
    .form-container form input[type="submit"]:hover {
      background-color: #444;
      color: #fff;
    }
    .form-container form select {
      background-color: #fff;
      font-size: 16px;
      cursor: pointer;
      appearance: none;
      -webkit-appearance: none;
      -moz-appearance: none;
      background-image: url('data:image/svg+xml;utf8,<svg fill="currentColor" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16"><path fill-rule="evenodd" d="M7.68 11.895a.75.75 0 0 1-1.06-1.06L7.94 9.44V5.75a.75.75 0 0 1 1.5 0v3.69l1.32 1.33a.75.75 0 0 1-1.06 1.06L8 10.56l-.32.32z"/></svg>');
      background-repeat: no-repeat;
      background-position: right 10px top 50%, 0 0;
      background-size: 16px auto, 100%;
    }
    .radio-group {
      display: flex;
      align-items: center;
      gap: 15px;
    }
    .radio-group input[type="radio"] {
      margin-right: 5px;
    }
    .radio-group label {
      margin: 0;
    }
    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
    }
    .checkbox-group label {
      display: flex;
      align-items: center;
      gap: 5px;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <h1>Les infections</h1>
      <div *ngFor="let complication of complications; let i = index">
        <h2>  Pulmonaire           - {{ i + 1 }}</h2>
        <!-- Patient Id -->
        <div>
          <label for="PatientId-{{i}}">Patient Id</label>
          <input type="number" id="PatientId-{{i}}" [(ngModel)]="complication.PatientId" name="PatientId-{{i}}" required>
        </div>

        <!-- Infection pulmonaire -->
        <div>
          <label>Infection pulmonaire:</label>
          <div class="radio-group">
            <input type="radio" id="PulmonaireOui-{{i}}" [(ngModel)]="complication.Pulmonaire" [value]="true" name="Pulmonaire-{{i}}">
            <label for="PulmonaireOui-{{i}}">Oui</label>
            <input type="radio" id="PulmonaireNon-{{i}}" [(ngModel)]="complication.Pulmonaire" [value]="false" name="Pulmonaire-{{i}}">
            <label for="PulmonaireNon-{{i}}">Non</label>
          </div>
        </div>

        <!-- Nombre -->
        <div *ngIf="complication.Pulmonaire">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="complication.Nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="complication.Pulmonaire">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="complication.Date" name="Date-{{i}}">
        </div>
         <!-- Lieu hospitalisation -->
         <div *ngIf="complication.Pulmonaire">
            <label for="LieuHospitalisation-{{i}}">Lieu Hospitalisation:</label>
            <input type="text" id="LieuHospitalisation-{{i}}" [(ngModel)]="complication.LieuHospitalisation" name="LieuHospitalisation-{{i}}">
          </div>
  

        <!-- Symptomatologie -->
        <div class="conditional-fields" *ngIf="complication.Pulmonaire">
            <label for="Symptomatologie-{{i}}">Symptomatologie:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="Dyspnee-{{i}}" [(ngModel)]="complication.Dyspnee" name="Dyspnee-{{i}}">
                Dyspnee
              </label>
              <label>
                <input type="checkbox" id="DouleurThoraciques-{{i}}" [(ngModel)]="complication.DouleurThoraciques" name="DouleurThoraciques-{{i}}">
                Douleur Thoraciques
              </label>
              <label>
                <input type="checkbox" id="Fievre-{{i}}" [(ngModel)]="complication.Fievre" name="Fievre-{{i}}">
                Fièvre
              </label>
              <label>
                <input type="checkbox" id="FoyerRadiologique-{{i}}" [(ngModel)]="complication.FoyerRadiologique" name="FoyerRadiologique-{{i}}">
                Foyer Radiologique
              </label>
              <label>
                <input type="checkbox" id="Desaturation-{{i}}" [(ngModel)]="complication.Desaturation" name="Desaturation-{{i}}">
                Desaturation
              </label>
              <label>
                <input type="checkbox" id="Autre-{{i}}" [(ngModel)]="complication.Autre" name="Autre-{{i}}">
                Autre
              </label>
            </div>
          </div>
          <!-- Preciser autre -->
        <div *ngIf="complication.Pulmonaire && complication.Autre">
            <label for="PreciserAutre-{{i}}">Preciser Autre:</label>
            <input type="text" id="PreciserAutre-{{i}}" [(ngModel)]="complication.PreciserAutre" name="PreciserAutre-{{i}}">
          </div>

         
          <!-- SaO2 -->
        <div *ngIf="complication.Pulmonaire">
            <label for="SaO2-{{i}}">SaO2:</label>
            <input type="text" id="SaO2-{{i}}" [(ngModel)]="complication.SaO2" name="SaO2-{{i}}">
          </div>

          <div *ngIf="complication.Pulmonaire">
            <label>Germe Isolé:</label>
            <div class="radio-group">
              <input type="radio" id="GermeIsoleOui-{{i}}" [(ngModel)]="complication.GermeIsole" [value]="true" name="GermeIsole-{{i}}">
              <label for="GermeIsoleOui-{{i}}">Oui</label>
              <input type="radio" id="GermeIsoleNon-{{i}}" [(ngModel)]="complication.GermeIsole" [value]="false" name="GermeIsole-{{i}}">
              <label for="GermeIsoleNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- TypeGerme -->
         <div *ngIf="complication.GermeIsole && complication.Pulmonaire">
            <label for="TypeGermeIsole-{{i}}">Type Germe isolé:</label>
            <input type="text" id="TypeGermeIsole-{{i}}" [(ngModel)]="complication.TypeGermeIsole" name="TypeGermeIsole-{{i}}">
          </div>
           <!-- Siege -->
         <div *ngIf="complication.GermeIsole && complication.Pulmonaire">
            <label for="Siege-{{i}}">Siege:</label>
            <input type="text" id="Siege-{{i}}" [(ngModel)]="complication.Siege" name="Siege-{{i}}">
          </div>
          
          <div *ngIf="complication.Pulmonaire">
            <label for="Crp-{{i}}">CRP (mg/l):</label>
            <input type="number" id="Crp-{{i}}" [(ngModel)]="complication.Crp" name="Crp-{{i}}">
          </div>

          <div *ngIf="complication.Pulmonaire">
            <label for="Vs-{{i}}">VS:</label>
            <input type="number" id="Vs{{i}}" [(ngModel)]="complication.Vs" name="Vs{{i}}">
          </div>
          
       
          <div *ngIf="complication.Pulmonaire">
            <label>Echographie:</label>
            <div class="radio-group">
              <input type="radio" id="EchographieOui-{{i}}" [(ngModel)]="complication.Echographie" [value]="true" name="Echographie-{{i}}">
              <label for="EchographieOui-{{i}}">Oui</label>
              <input type="radio" id="EchographieNon-{{i}}" [(ngModel)]="complication.Echographie" [value]="false" name="Echographie-{{i}}">
              <label for="EchographieNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- Resultat -->
         <div *ngIf="complication.Echographie && complication.OsteomyeliteAigue">
            <label for="ResultatEchographie-{{i}}">Résultat:</label>
            <input type="text" id="ResultatEchographie-{{i}}" [(ngModel)]="complication.ResultatEchographie" name="ResultatEchographie-{{i}}">
          </div>
          <div *ngIf="complication.OsteomyeliteAigue">
            <label>Irm:</label>
            <div class="radio-group">
              <input type="radio" id="IrmOui-{{i}}" [(ngModel)]="complication.Irm" [value]="true" name="Irm-{{i}}">
              <label for="IrmOui-{{i}}">Oui</label>
              <input type="radio" id="IrmNon-{{i}}" [(ngModel)]="complication.Irm" [value]="false" name="Irm-{{i}}">
              <label for="IrmNon-{{i}}">Non</label>
            </div>
          </div>
          <!-- Resultat -->
         <div *ngIf="complication.Irm && complication.OsteomyeliteAigue">
            <label for="ResultatIrm-{{i}}">Résultat:</label>
            <input type="text" id="ResultatIrm-{{i}}" [(ngModel)]="complication.ResultatIrm" name="ResultatIrm-{{i}}">
          </div>
          <div *ngIf="complication.OsteomyeliteAigue">
            <label>Germe Isolé:</label>
            <div class="radio-group">
              <input type="radio" id="GermeIsoleOui-{{i}}" [(ngModel)]="complication.GermeIsole" [value]="true" name="GermeIsole-{{i}}">
              <label for="GermeIsoleOui-{{i}}">Oui</label>
              <input type="radio" id="GermeIsoleNon-{{i}}" [(ngModel)]="complication.GermeIsole" [value]="false" name="GermeIsole-{{i}}">
              <label for="GermeIsoleNon-{{i}}">Non</label>
            </div>
          </div>
           <!-- TypeGerme -->
         <div *ngIf="complication.GermeIsole && complication.OsteomyeliteAigue">
            <label for="TypeGermeIsole-{{i}}">Type Germe isolé:</label>
            <input type="text" id="TypeGermeIsole-{{i}}" [(ngModel)]="complication.TypeGermeIsole" name="TypeGermeIsole-{{i}}">
          </div>

          <!-- Siege -->
        <div class="conditional-fields" *ngIf="complication.OsteomyeliteAigue">
            <label for="Traitement-{{i}}">Siege:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="Hemoculture-{{i}}" [(ngModel)]="complication.Hemoculture" name="Hemoculture-{{i}}">
                Hémocultures
              </label>
              <label>
                <input type="checkbox" id="PortEntree-{{i}}" [(ngModel)]="complication.PortEntree" name="PortEntree-{{i}}">
                Port Entree              
              </label>
              <label>
                <input type="checkbox" id="PrelevementLocal-{{i}}" [(ngModel)]="complication.PrelevementLocal" name="PrelevementLocal-{{i}}">
                Prelevement Local
              </label>
              <label>
                <input type="checkbox" id="AutreSiege-{{i}}" [(ngModel)]="complication.AutreSiege" name="AutreSiege-{{i}}">
                Autre Siege
              </label>
              
            </div>
          </div>
          <!-- PrciserAutreSiege -->
        <div *ngIf="complication.OsteomyeliteAigue && complication.AutreSiege">
            <label for="PrciserAutreSiege-{{i}}">Preciser Autre Siege:</label>
            <input type="text" id="PrciserAutreSiege-{{i}}" [(ngModel)]="complication.PrciserAutreSiege" name="PrciserAutreSiege-{{i}}">
          </div>

        <!-- Traitement -->
        <div class="conditional-fields" *ngIf="complication.OsteomyeliteAigue">
          <label for="Traitement-{{i}}">Traitement:</label>
          <div class="checkbox-group">
            <label>
              <input type="checkbox" id="AntalgiquesPalliesI-{{i}}" [(ngModel)]="complication.AntalgiquesPalliesI" name="AntalgiquesPalliesI-{{i}}">
              Antalgiques pallier I
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIi-{{i}}" [(ngModel)]="complication.AntalgiquePallierIi" name="AntalgiquePallierIi-{{i}}">
              Antalgique pallier II
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIii-{{i}}" [(ngModel)]="complication.AntalgiquePallierIii" name="AntalgiquePallierIii-{{i}}">
              Antalgique pallier III
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="complication.HyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
              Hyperhydratation perso
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="complication.HyperhydratationIv" name="HyperhydratationIv-{{i}}">
              Hyperhydratation IV
            </label>
            <label>
              <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="complication.TransfusionSimple" name="TransfusionSimple-{{i}}">
              Transfusion simple
            </label>
            <label>
                <input type="checkbox" id="EchangeTransfusionnel-{{i}}" [(ngModel)]="complication.EchangeTransfusionnel" name="EchangeTransfusionnel-{{i}}">
                Echange transfusionnel
              </label>
            <label>
                <input type="checkbox" id="Immobilisation{{i}}" [(ngModel)]="complication.Immobilisation" name="Immobilisation{{i}}">
                Immobilisation
            </label> 
          </div>
        </div>
 <!-- Type Antibiotherapie -->
 <div *ngIf="complication.OsteomyeliteAigue">
    <label for="TypeAntibiotherapie-{{i}}">Type Antibiotherapie:</label>
    <input type="text" id="TypeAntibiotherapie-{{i}}" [(ngModel)]="complication.TypeAntibiotherapie" name="TypeAntibiotherapie-{{i}}">
  </div>

  <!-- Duree Antibiotherapie -->
  <div *ngIf="complication.OsteomyeliteAigue">
    <label for="Duree-{{i}}">Duree Antibiotherapie:</label>
    <input type="number" id="Duree-{{i}}" [(ngModel)]="complication.Duree" name="Duree-{{i}}">
  </div>
      </div>
      
      <div class="submit-row">
        <input type="button" (click)="addComplication()" value="Ajouter Crise ">
      </div>
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
</html>
